import React from 'react';
import Login from './loginpage'
import useLocalStorage from '../hooks/localstorage.js' 


function App() {

  const [login, setLogin] = useLocalStorage('login');

  return (
    <> 
        {login}
    <Login onLoginSubmit = {setLogin} />
</>
  );
}

export default App;
